use srvmsg_rs::srvmsg::srv::{AddTwoInts, AddTwoIntsResponse}; fn main() -> Result<(), DynError> { // Create a context. let ctx = Context::new()?; // Create a node. let node = ctx.create_node("server_node", None, Default::default())?; // Create a server. let server = node.create_server::<AddTwoInts>("my_service", Some(Profile::default()))?; // Create a selector. let mut selector = ctx.create_selector()?; // Create a logger. let logger = Logger::new("server"); selector.add_server( server, Box::new(move |msg, _header| { let mut response = AddTwoIntsResponse::new().unwrap(); pr_error!(logger, "recv: {:?}", msg); response.result = msg.x + msg.y; response }), ); loop { selector.wait()?; // Spin. }
} Let's dig into detail. // Create a server.
let server = node.create_server::<AddTwoInts>("my_service", Some(Profile::default()))?; AddTwoInts of create_server::<AddTwoInts> indicates the protocol of the server. The arguments of "my_service" and Some(Profile::default()) are the service name and QoS. If you pass None instead of Some(Profile::default()), Profile::default() is used. The callback was passed as follows. selector.add_server( server, Box::new(move |msg, _header| { let mut response = AddTwoIntsResponse::new().unwrap(); pr_error!(logger, "recv: {:?}", msg); response.result = msg.x + msg.y; response }),
); The callback function must take a message sent by a client and a header including sequence number, time, etc. msg's types is AddTwoIntsRequest and a value of AddTwoIntsResponse, which is a response, must be returned.

