We recommend to use async/await to implement a client, because a client wait a response, but when the response is replied is unpredictable. In this tutorial, we use Tokio , which is the most popular asynchronous library of Rust. use safe_drive::{ context::Context, error::DynError, logger::Logger, pr_error, pr_info, pr_warn, qos::Profile,
};
use srvmsg_rs::srvmsg::srv::{AddTwoInts, AddTwoIntsRequest};
use std::time::Duration;
use tokio::time::timeout; #[tokio::main]
async fn main() -> Result<(), DynError> { // Create a context and a node. let ctx = Context::new()?; let node = ctx.create_node("client", None, Default::default())?; let logger = Logger::new("client"); // Create a client. let mut client = node.create_client::<AddTwoInts>("my_service", Some(Profile::default()))?; let mut n = 0; loop { let mut request = AddTwoIntsRequest::new().unwrap(); request.x = n; request.y = n + 1; n += 1; // Send a request. let client_rcv = client.send(&request)?; // Receive a request. let mut receiver = client_rcv.recv(); match timeout(Duration::from_secs(1), &mut receiver).await { Ok(Ok((c, response, _header))) => { pr_info!(logger, "received {:?}", response); client = c; } Ok(Err(e)) => { pr_error!(logger, "error: {e}"); return Err(e); } Err(elapsed) => { pr_warn!(logger, "timeout: {elapsed}"); client = receiver.give_up(); } } tokio::time::sleep(Duration::from_secs(1)).await; }
} Because a response will be never returned, we use tokio::time::timeout to receive a response. timeout(Duration::from_secs(1), &mut receiver).await takes a duration and a awaitable future. The awaitable future can be taken by client_rcv.recv(). Note that it uses tokio::time::sleep instead of std::thread::sleep because to avoid calling blocking functions. client.send() consumes client and it returns client_recv to receive a response. client_rcv.recv() consumes client_recv and client_rcv.recv().await returns new client, a response, and a header. The new client must be used to send next request. This means that you cannot ignore receiving a response. If you forget to receive a response, you cannot send any request again, because you need to get a new client by receiving a response.. Otherwise, you encountered compilation errors.

